import React from 'react';
import { NavLink } from 'react-router-dom';

const navItems = [
  { to: "/", label: "Home" },
  { to: "/students", label: "Students" },
  { to: "/staff", label: "Staff" },
  { to: "/unknowns", label: "Unknowns" },
  { to: "/upload", label: "Upload" },
  { to: "/live", label: "Live Feed" },
  { to: "/logs", label: "Logs" },
  { to: "/chatlogs", label: "Chat Logs" },
  { to: "/collegeinfo", label: "College Info" },
  { to: "/robotview", label: "Robot View" },
  { to: "/robotcontroller", label: "Robot Controller" }
];

export default function Header() {
  return (
    <header className="w-full bg-gradient-to-r from-blue-800 via-blue-600 to-indigo-600 shadow-md py-4 px-8 flex flex-col md:flex-row items-center justify-between">
      <div className="flex items-center space-x-4 mb-2 md:mb-0">
        <svg xmlns="http://www.w3.org/2000/svg" className="h-8 w-8 text-white" fill="none" viewBox="0 0 24 24" stroke="currentColor"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 6l8 4-8 4-8-4 8-4zm0 8v6m0 0H6m6 0h6" /></svg>
        <span className="text-2xl font-extrabold tracking-wide text-white font-serif whitespace-nowrap">Chettinad College of Engineering and Technology</span>
      </div>
      <nav className="flex flex-wrap gap-2 md:gap-4">
        {navItems.map(item => (
          <NavLink
            key={item.to}
            to={item.to}
            className={({ isActive }) =>
              `px-3 py-1 rounded-md font-medium transition-colors duration-200 ${isActive ? 'bg-white text-blue-800 shadow' : 'text-white hover:bg-blue-700/70'}`
            }
            end={item.to === "/"}
          >
            {item.label}
          </NavLink>
        ))}
      </nav>
      <div className="hidden md:block text-white text-sm font-medium ml-4">Empowering Innovation</div>
    </header>
  );
}
